import React, {Component} from 'react';
import '../scss/binario.scss'
import {isElementOfType} from "react-dom/test-utils";

class Binario extends Component {

  state=
      {
          'NumberBinaire': 0,
          'NumberDecimale':0,
          'Resultato':0
      }

    Vedi=(e)=>{
        e.preventDefault();
        console.log(this.state.NumberBinaire);
    }
    GetValueBin=(e)=>{
      var nouvo=e.target.value
     this.setState(this.state,()=> {
           console.log( parseInt(nouvo) )
         }
     )
        console.log(this.state.NumberBinaire);
    }

    render() {
        return (
            <div className='binario'>
               <h3> conversion <br />base [ 10 --> 2  &&  [ 2 --> 10 ]</h3>
               <div className='forms'>
                  <div className='form'>
                      <div className='space'>
                          <h5>convert To binario</h5>
                          <form className='form_10_2 '>
                              <input type="text" placeholder="Your Number" className="txtb" name='base10' onChange={this.GetValueBin} />
                              <button className='convert' onSubmit={this.Vedi}> ->  </button>
                          </form>
                      </div>
                      <div className='space'>
                          <h5>convert To decimal</h5>
                          <form className='form_2_10 '>
                              <input type="text" placeholder="Your Number" className="txtb" name='base10' onChange={this.Vedi}/>
                              <button className='convert'> -> </button>
                          </form>
                      </div>
                  </div>
               </div>
            </div>
        );
    }
}

export default Binario;
